import React from 'react';
//import logo from './logo.svg';
import './App.css';
import {BrowserRouter as Router, Switch, Route} from 'react-router-dom'
import Home from './pages/Home'
import Extra from './pages/Extra'



function App() {
  return (
    <Router>
      <Switch>
        <Route exact path = "/">
          <Home/>
        </Route>
        <Route exact path = "/Extra">
          <Extra/>
        </Route>
      </Switch>
    </Router>

  );
}

export default App;
